import '../../styles/Main.css';
import logo from '../../img/logo.svg';
import SearchForm from './SearchForm';
import UserInterface from './UserInterface';

function Header() {
	return (
	    <div className="mainLogo">
            <img src={logo} alt="logo" />
            <SearchForm/>
            <UserInterface/>
        </div>
  	);
}

export default Header;
